Method.Source:
    [Form]
    public class CatDisplayVendorAdd extends FormRun
    {
        //************************************************************
        // VendCategory
        //   InnerJoin EcoResCategory
        //   InnerJoin VendTable
        //     InnerJoin DirPartyTable
        //   InnerJoin VendProcurementCategoryStatus (to get only currently-effective VendCategory)
        //   NotExistJoin CatDisplayVendorCategory (to exclude Vendors from ManuallyAdded|ManuallyHidden)
        //
        // Note: technically we don't care about ManuallyHidden - but since it takes extra work to exclude only ManuallyAdded, we simply exclude all in CatDisplayVendorCategory):
        //   - a hidden vendor would belong to *the* EcoResCategory, and all vendors from *the* EcoResCategory are already excluded (see EcoResCategory.init).
        //
        // Note: excluding the particular RecId in EcoResCategory to exclude all Vendors from ProcurementCategory is *not* correct
        //   - inherited Vendors would not be accounted for.
        //************************************************************

        CatDisplayCategorySharedInfo    displayCategorySharedInfo;
        EcoResCategoryHierarchy         categoryHierarchy;
}

public void init()
{
    // gets the record BEFORE handleInitPreSuper sets it to null:
    CatDisplayCategoryTable tblDCategory = element.args().record();

    displayCategorySharedInfo = CatDisplayCategorySharedInfo::findByRecId(tblDCategory.SharedData);

    // - cannnot use displayCategorySharedInfo directly since displayCategorySharedInfo.Category could be null
    categoryHierarchy = CatProcureCatalogTable::findProcurementHierarchy();

    super();
}

/// <summary>
/// Performs the necessary actions when the OK button is clicked.
/// </summary>
public void okBtnClicked()
{
    CatDisplayVendorCategory              displayVendorCategoryAdded;
    VendTmpProcurementCategory            vendTmpProcurementCategoryLocal;
    VendCategory                          vendCategoryLocal;
    EcoResCategory                        categoryLocal;
    int                                   nAdded = 0;

    vendTmpProcurementCategoryLocal.setTmpData(VendTmpProcurementCategory);
    ttsbegin;
    while select * from vendTmpProcurementCategoryLocal
    {
        select firstonly crossCompany Category from vendCategoryLocal
            where  vendCategoryLocal.VendorDataArea == vendTmpProcurementCategoryLocal.VendorDataAreaId
                && vendCategoryLocal.VendorAccount  == vendTmpProcurementCategoryLocal.VendorAccountNumber
            join RecId from categoryLocal
                where  categoryLocal.Name              == vendTmpProcurementCategoryLocal.ProcurementCategoryName
                    && categoryLocal.CategoryHierarchy == categoryHierarchy.RecId
                    && categoryLocal.RecId             == vendCategoryLocal.Category
            outer join forUpdate Origin from displayVendorCategoryAdded
                where  displayVendorCategoryAdded.VendorCategory == vendCategoryLocal.RecId
                    && displayVendorCategoryAdded.SharedData     == displayCategorySharedInfo.RecId
                    // && displayVendorCategoryAdded.Origin      == CatDisplayOrigin::ManuallyAdded
                    // *******************************************************
                    // WHY did we intentionally ignore the Origin filter below???
                    // - to handle this scenario, which otherwise would cause runtime error due to UNIQUE INDEX (SharedData, VendorCategory) on CatDisplayVendorCategory
                    //      -- VendTable VT1 is associated with C1 (VC1); SD1 points to C1
                    //      -- VT1 is hidden in SD1: CatDisplayVendorCategory has DVC1 with (SharedData, VendorCategory)=(SD1,VC1)
                    //      -- Vendor VT1 is re-associated with C2 (updated VC1) - but DVC1 record remains, and unchanged
                    //      ---- in this case all we need to do is just finding DVC1 and update it (see code below).
                    //      ---- if instead we add Origin filter above, the insert code below will cause UNIQUE INDEX violation.
                    // *******************************************************
        ;
        if ( ! displayVendorCategoryAdded.RecId)
        {
            nAdded++;
            displayVendorCategoryAdded.clear();
            displayVendorCategoryAdded.Origin = CatDisplayOrigin::ManuallyAdded;
            // NOTE - recall that we used Category to (temporarily) store actual VendCategory.RecId of selected record
            displayVendorCategoryAdded.VendorCategory = vendCategoryLocal.RecId;
            displayVendorCategoryAdded.SharedData = displayCategorySharedInfo.RecId;
            displayVendorCategoryAdded.insert();
        }
        else if (CatDisplayOrigin::ManuallyAdded != displayVendorCategoryAdded.Origin)
        {
            displayVendorCategoryAdded.Origin = CatDisplayOrigin::ManuallyAdded;
            displayVendorCategoryAdded.update();
        }
    }
    ttscommit;

    if (nAdded > 0)
    {
        if (element.args().caller())
        {
            // notify parent FORM to refresh
            element.args().caller().addVendorsFormClosing(true);
        }
    }
}

public void run()
{
    super();

    this.setButtonState();
    element.wait(true);
}

/// <summary>
/// Enable and disable the buttons dependending on whether the corresponding grid is empty.
/// </summary>
public void setButtonState()
{
    // addBtn    works on the top    which is bound to VendCategory
    // removeBtn works on the bottom which is bound to VendTmpProcurementCategory
    addBtn.enabled(vendCategory.RecId);
    removeBtn.enabled(VendTmpProcurementCategory.RecId);
}

public void init()
{
    QueryBuildDataSource        qbdsCategory;
    QueryBuildRange             qbrCategory;

    super();

    qbdsCategory = this.query().dataSourceTable(tablenum(EcoResCategory));

    qbrCategory = qbdsCategory.addRange(fieldnum(EcoResCategory, RecId), 1);
    // exclude vendors associated with this EcoResCategory node
    qbrCategory.value(strfmt('(%1 != %2)',
        fieldstr(EcoResCategory, RecId),
        queryValue(displayCategorySharedInfo.Category)
    ));
    if (categoryHierarchy.RecId)
    {
        qbdsCategory.addRange(fieldnum(EcoResCategory, CategoryHierarchy))
            .value(queryValue(categoryHierarchy.RecId));
    }
}

public void init()
{
    QueryBuildDataSource        qbdsDisplayVendorCategory;

    super();

    qbdsDisplayVendorCategory = this.query().dataSourceTable(tablenum(CatDisplayVendorCategory));

    // only the CatDisplayVendorCategory record for the SharedData:
    qbdsDisplayVendorCategory.addRange(fieldnum(CatDisplayVendorCategory, SharedData))
        .value(queryValue(displayCategorySharedInfo.RecId));
}

void clicked()
{
    EcoResCategory              categoryLocal;
    DirPartyTable               partyLocal;
    VendTable                   vendTableLocal;
    VendCategory                vendCategorySelected;
    VendTmpProcurementCategory  vendTmpProcurementCategoryLocal;
    FormDataSource              ds = vendCategory_ds;
    int                         nAdded = 0;

    vendCategorySelected = ds.getFirst(true) ? ds.getFirst(true) : ds.cursor();

    while (vendCategorySelected)
    {
        vendTmpProcurementCategoryLocal.setTmpData(VendTmpProcurementCategory);

        categoryLocal = EcoResCategory::find(vendCategorySelected.Category);
        select firstonly crossCompany Name from partyLocal
            join RecId from vendTableLocal
                where  vendTableLocal.Party      == partyLocal.RecId
                    && vendTableLocal.AccountNum == vendCategorySelected.VendorAccount
                    && vendTableLocal.DataAreaId == vendCategorySelected.VendorDataArea
        ;
        // VendTable's (DataAreaId,AccountNum) is unique
        // EcoResCategory's (CategoryHierarchy,Name) is unique
        select firstonly vendTmpProcurementCategoryLocal
            where  vendTmpProcurementCategoryLocal.ProcurementCategoryName == categoryLocal.Name
                && vendTmpProcurementCategoryLocal.VendorDataAreaId        == vendCategorySelected.VendorDataArea
                && vendTmpProcurementCategoryLocal.VendorAccountNumber     == vendCategorySelected.VendorAccount
        ;

        if (!vendTmpProcurementCategoryLocal.RecId)
        {
            nAdded++;
            VendTmpProcurementCategory.clear();
            VendTmpProcurementCategory.ProcurementCategoryName      = categoryLocal.Name;
            VendTmpProcurementCategory.VendorDataAreaId             = vendCategorySelected.VendorDataArea;
            VendTmpProcurementCategory.VendorAccountNumber          = vendCategorySelected.VendorAccount;
            VendTmpProcurementCategory.VendorPartyName              = partyLocal.Name;
            VendTmpProcurementCategory.doInsert();
        }

        vendCategorySelected = ds.getNext();
    }

    if (nAdded > 0)
    {
        // Refresh grid
        VendTmpProcurementCategory_ds.executeQuery();
        // Reset button state
        element.setButtonState();
    }

    super();
}

void clicked()
{
    ttsBegin;
    if (vendTmpProcurementCategory_ds.anyMarked())
    {
        vendTmpProcurementCategory_ds.deleteMarked();
    }
    else if (getFirstSelection(vendTmpProcurementCategory_ds))
    {
        vendTmpProcurementCategory_ds.delete();
    }
    ttsCommit;

    // Refresh grid
    vendTmpProcurementCategory_ds.executeQuery();
    // Reset button state
    element.setButtonState();
}
